import React, { useState } from 'react';
import './CSS/CSS_FILE.css';
function About() {
    function enteremail() {
        const div1 = document.getElementById('content4');
        const div2 = document.getElementById('content5');
        div1.style.display = 'none';
        div2.style.display = 'flex';
      }
      function backtoname() {
        const div1 = document.getElementById('content4');
        const div2 = document.getElementById('content5');
        div1.style.display = 'flex';
        div2.style.display = 'none';
      }
      function submit() {
        const div1 = document.getElementById('content4');
        const div2 = document.getElementById('content5');
        const div3 = document.getElementById('content6');
        div1.style.display = 'none';
        div2.style.display = 'none';
        div3.style.display = 'flex';
      }
    return (
                <div>
                    <div class="section" id="content">
                        <div class="content4" id="content4">
                            <div class="contacthead">
                                <h1>
                                    <center>Hire Me</center>
                                </h1>
                            </div>
                            <div class="contactsub">
                                <center>Complete the form to get in touch with me</center>
                            </div>
                            <div class="input">
                                <div><i class="bi bi-person"></i></div>
                                <input type="text" id="username" name="username" placeholder="Enter Your Name" />
                            </div>
                            <button onclick={enteremail()} class="getstarted">Get Started</button>
                        </div>
                        <div class="content5" id="content5">
                            <div class="contactsub">
                                <center>Your Email*</center>
                            </div>
                            <div class="input">
                                <div><i class="bi bi-envelope"></i></div>
                                <input type="text" id="email" name="username" placeholder="Enter Your Email" />
                            </div>
                            <div class="textarea">
                                <textarea type="text" id="query" name="username" placeholder="Tell me about your needs"></textarea>
                            </div>
                            <div class="twobutt">
                                <button onclick="backtoname()" class="backtoname">Back</button>
                                <button onclick="submit()" class="submit">Submit</button>
                            </div>
                        </div>
                        <div class="content6" id="content6">
                            <div class="contacthead">
                                <h1>
                                    <center>Thank You!</center>
                                </h1>
                            </div>
                            <div class="contactsub">
                                <center>Your message is on its way and I will try to respond as soon as possible.</center>
                            </div>
                        </div>
                    </div>
                </div>
    );
}
export default About;
